import React from 'react';

const About = () => {
  return (
    <div className='flex justify-content shadow-lg bg-red-100'>
      <div className='absolute border border-white justify-center'>
        <h1 className=' justify-center my-4'>About</h1>
      </div>
      <div className='grid gap-4 container bg-slate-200 rounded-lg mr-5 m-10 shadow-lg'> 
          <h1 className='text-white text-4xl m-4'>Judul</h1>
      </div>
      <div className='grid gap-4 container bg-slate-200 rounded-lg ml-5 m-10 shadow-lg'>
          <h1 className='text-white text-4xl m-4'>Judul </h1>
          <p className='m-4'>lorem ipsum  </p>
      </div>
    </div>
  )
}

export default About;
